(function () {

    try {

        let NewCommon = {
            init: () => {},
            windowOnload: () => {},
            ajaxStop: () => {}
        };

        // Instanciando a funcao
        $(document).ready(NewCommon.init);
        let windowLoad = function () {
            NewCommon.windowOnload();
        };
        $(window).load(windowLoad);
        $(document).ajaxStop(NewCommon.ajaxStop);
        
    } catch (e) {
        console.log("Erro na inst√¢ncia do [NewCommon]: ", e);
    }

})();
